import 'package:flutter/cupertino.dart';typedef RouteFunction = Widget Function(BuildContext a);class Routes {  Routes() {    throw UnimplementedError(        "RoutesMap does not allow creating object. Just use static variables");  }  static const String home = "/";  static const String settings = "/settings";  static List<String> toList() {    return [home, settings];  }  static void changeRoute(    Widget page,    BuildContext context,  ) {    Navigator.push(        context,        PageRouteBuilder(          pageBuilder: (context, animation, secondaryAnimation) {            return page;          },          transitionDuration: Duration.zero,        ));  }}